import React from 'react'
import { BrowserRouter, Routes, Route } from "react-router-dom"
import User from './component/user/User';
import Navigation from './component/Navigation';

function App() {
  return (
    <div>
      <Navigation />
      <BrowserRouter>
        <Routes>
          <Route path="/register" element={<User />} />
        </Routes>
      </BrowserRouter>
    </div>
  )
}

export default App
